import React from "react";
import Logo from "../images/SM_logo.png";
import {Typography} from "@material-ui/core/";
const Contact = props => {
    return (
        <div>
            <img src = {Logo} alt="Shawn Morreau&apos;s logo" className = "logo"></img>
            <section>
                <Typography
                    align='center'
                    noWrap
                    variant = "h2"
                    component = "h1"
                >Let's get in touch!</Typography>


            </section>
        </div>
    );
}

export default Contact;
